(66839, '784DD8DF-BA92-4ECB-95E0-BECC6ED7A517', 'I also reread Priscilla’s note to us.   My wish is that both of you can use this time to take some very very deep breaths, have a sense of your body, embodiment, and feel the feelings that are all in there. Slowly and gently reflect on your part of the situation, and then when the time is right, reconvene with each other to take responsibility for your part, and to listen openly to the other.  It would be helpful for me to hear you articulate in your own words what you see as your part of the situation. I see you have taken some action with Garrett that is a recognition of one part.  I am going to take some time to reflect and write down what I see as my part and what I am going to do about it and share with you tomorrow night. If you feel ready and have the time and heart space  to do the same, let me know. It could be a meaningful way for us to rebuild our connection.', '699546391311508864', 'None', 1, 'David', 'Nitzan', 0, '', '', '', 'iMessage', 'E:nwdave@b-zb.com', 'David', '2023-03-03T06:26:31.311509'),
